styles:
.banner {
  background: #05ACFF;
  background: -moz-linear-gradient(-210deg, rgba(0,120,215,1) 40%, rgba(6,152,234,1) 100%); /* FF3.6-15 */
  background: -webkit-linear-gradient(-210deg, rgba(0,120,215,1) 40%,rgba(6,152,234,1) 100%); /* Chrome10-25,Safari5.1-6 */
  background: linear-gradient(30deg, rgba(0,120,215,1) 40%,rgba(6,152,234,1) 100%); /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
  filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#0078d7', endColorstr='#0698ea',GradientType=1 ); /* IE6-9 fallback on horizontal gradient */
  color: white;
  padding: 24px 32px;;
}

.banner >>> a {
  color: white;
  text-decoration: underline;
}

.banner >>>  a:hover, .banner >>>  a:focus, .banner >>> a:active {
  color: white;
  text-decoration: none;
}

.banner >>> .progress-cover {
  background: transparent
}

.banner >>> .progress-ring .progress-circle:after
{
  color: white;
}

.banner .update-link {
  display:inline-block;
  margin-left: 17px;
}

.feedback-notice{
  max-width: 675px;
  margin-bottom: 24px;
  white-space: pre-line;
  text-align: justify;
}

